}","export class ContactService {
 constructor() {
 this.tableName = "x_1507361_job_trac_contact";
 }

 async list(filters = {}) {
 try {
 const searchParams = new URLSearchParams(filters);
 searchParams.set('sysparm_display_value', 'all');
 searchParams.set('sysparm_limit', '1000');
 searchParams.set('sysparm_order_by', 'name');

 const response = await fetch(`/api/now/table/${this.tableName}?${searchParams.toString()}`, {
 method: "GET",
 headers: {
 "Accept": "application/json",
 "X-UserToken": window.g_ck
 },
 });

 if (!response.ok) {
 const error = await response.json();
 throw new Error(error.error?.message || 'Failed to fetch contacts');
 }

 const { result } = await response.json();
 return result || [];
 } catch (error) {
 console.error('Error fetching contacts:', error);
 throw error;
 }
 }

 async create(data) {
 try {
 const response = await fetch(`/api/now/table/${this.tableName}`, {
 method: "POST",
 headers: {
 "Content-Type": "application/json",
 "Accept": "application/json",
 "X-UserToken": window.g_ck
 },
 body: JSON.stringify(data),
 });

 if (!response.ok) {
 const error = await response.json();
 throw new Error(error.error?.message || 'Failed to create contact');
 }

 return response.json();
 } catch (error) {
 console.error('Error creating contact:', error);
 throw error;
 }
 }

 async update(sysId, data) {
 try {
 const response = await fetch(`/api/now/table/${this.tableName}/${sysId}`, {
 method: "PATCH",
 headers: {
 "Content-Type": "application/json",
 "Accept": "application/json",
 "X-UserToken": window.g_ck
 },
 body: JSON.stringify(data),
 });

 if (!response.ok) {
 const error = await response.json();
 throw new Error(error.error?.message || 'Failed to update contact');
 }

 return response.json();
 } catch (error) {
 console.error('Error updating contact:', error);
 throw error;
 }
 }

 async delete(sysId) {
 try {
 const response = await fetch(`/api/now/table/${this.tableName}/${sysId}`, {
 method: "DELETE",
 headers: {
 "Accept": "application/json",
 "X-UserToken": window.g_ck
 },
 });

 if (!response.ok) {
 const error = await response.json();
 throw new Error(error.error?.message || 'Failed to delete contact');
 }

 return response.ok;
 } catch (error) {
 console.error('Error deleting contact:', error);
 throw error;
 }
 }
}

