export default function JobApplications({ initialFilters = {}, editingApplication = null }) {
 const [applications, setApplications] = useState([]);
 const [platforms, setPlatforms] = useState([]);
 const [contacts, setContacts] = useState([]);
 const [loading, setLoading] = useState(true);
 const [error, setError] = useState(null);
 const [showForm, setShowForm] = useState(false);
 const [showContactForm, setShowContactForm] = useState(false);
 const [editingApp, setEditingApp] = useState(null);
 const [editingData, setEditingData] = useState(null);
 const [searchTerm, setSearchTerm] = useState('');
 const [statusFilter, setStatusFilter] = useState(initialFilters.statusFilter || '');
 const [priorityFilter, setPriorityFilter] = useState(initialFilters.priorityFilter || '');

 const jobService = new JobApplicationService();
 const platformService = new JobPlatformService();
 const contactService = new ContactService();

 useEffect(() => {
 loadData();
 }, []);

 // Apply initial filters when they change
 useEffect(() => {
 setStatusFilter(initialFilters.statusFilter || '');
 setPriorityFilter(initialFilters.priorityFilter || '');
 }, [initialFilters]);

 // Handle editing application from dashboard
 useEffect(() => {
 if (editingApplication) {
 handleEdit(editingApplication);
 }
 }, [editingApplication]);

 const loadData = async () => {
 try {
 setLoading(true);
 setError(null);
 const [appsData, platformsData, contactsData] = await Promise.all([
 jobService.list(),
 platformService.list(),
 contactService.list()
 ]);
 setApplications(appsData);
 setPlatforms(platformsData);
 setContacts(contactsData);
 } catch (err) {
 setError('Failed to load applications. Please try again.');
 console.error(err);
 } finally {
 setLoading(false);
 }
 };

 const handleSubmit = async (e) => {
 e.preventDefault();
 const formData = new FormData(e.target);
 const data = Object.fromEntries(formData);

 try {
 if (editingApp) {
 await jobService.update(editingApp, data);
 } else {
 await jobService.create(data);
 }
 await loadData();
 setShowForm(false);
 setEditingApp(null);
 setEditingData(null);
 } catch (err) {
 setError(err.message);
 }
 };

 const handleContactSubmit = async (e) => {
 e.preventDefault();
 const formData = new FormData(e.target);
 const data = Object.fromEntries(formData);

 try {
 const response = await contactService.create(data);
 await loadData(); // Refresh contacts list
 setShowContactForm(false);

 // Auto-select the newly created contact
 if (response.result && response.result.sys_id) {
 const contactSelect = document.querySelector('select[name="primary_contact"]');
 if (contactSelect) {
 contactSelect.value = response.result.sys_id;
 }
 }
 } catch (err) {
 setError('Failed to create contact: ' + err.message);
 }
 };

 const handleEdit = (app) => {
 const sysId = typeof app.sys_id === 'object' ? app.sys_id.value : app.sys_id;
 setEditingApp(sysId);
 setEditingData(app);
 setShowForm(true);
 };

 const handleDelete = async (sysId) => {
 if (confirm('Are you sure you want to delete this application?')) {
 try {
 await jobService.delete(sysId);
 await loadData();
 } catch (err) {
 setError(err.message);
 }
 }
 };

 const filteredApplications = applications.filter(app => {
 const jobTitle = typeof app.job_title === 'object' ? app.job_title.display_value : app.job_title;
 const company = typeof app.company_name === 'object' ? app.company_name.display_value : app.company_name;
 const status = typeof app.application_status === 'object' ? app.application_status.value : app.application_status;
 const priority = typeof app.priority === 'object' ? app.priority.value : app.priority;

 const matchesSearch = !searchTerm || 
 jobTitle?.toLowerCase().includes(searchTerm.toLowerCase()) ||
 company?.toLowerCase().includes(searchTerm.toLowerCase());

 const matchesStatus = !statusFilter || status === statusFilter;
 const matchesPriority = !priorityFilter || priority === priorityFilter;

 return matchesSearch && matchesStatus && matchesPriority;
 });

 const getDefaultValue = (field) => {
 if (!editingData) return '';
 const value = editingData[field];
 if (typeof value === 'object' && value !== null) {
 return value.value || value.display_value || '';
 }
 return value || '';
 };

 if (loading) {
 return (
 <div className="loading">
 <div className="loading-spinner"></div>
 <p>Loading applications...</p>
 </div>
 );
 }

 if (error) {
 return <div className="error">{error}</div>;
 }

 return (
 <div className="job-applications">
 <div className="page-header">
 <div>
 <h2>Job Applications</h2>
 <p className="text-secondary">
 {initialFilters.statusFilter 
