const CHART_TYPES = {
 bar: { name: 'Bar Chart', icon: '' },
 pie: { name: 'Pie Chart', icon: '' },
 line: { name: 'Trend Line', icon: '' },
 donut: { name: 'Donut Chart', icon: '' },
 horizontal: { name: 'Horizontal Bar', icon: '' }
};

export default function Analytics() {
 const [analytics, setAnalytics] = useState(null);
 const [applications, setApplications] = useState([]);
 const [loading, setLoading] = useState(true);
 const [chartType, setChartType] = useState('bar');
 const [timeframe, setTimeframe] = useState('all');

 const jobService = new JobApplicationService();

 useEffect(() => {
 loadAnalytics();
 }, []);

 const loadAnalytics = async () => {
 try {
 const [analyticsData, appsData] = await Promise.all([
 jobService.getAnalytics(),
 jobService.list()
 ]);
 setAnalytics(analyticsData);
 setApplications(appsData);
 } catch (error) {
 console.error('Error loading analytics:', error);
 } finally {
 setLoading(false);
 }
 };

 const getStatusData = () => {
 if (!analytics) return [];
 return [
 { label: 'Applied', value: analytics.applied, color: '#4a90e2' },
 { label: 'Interviewing', value: analytics.interviewing, color: '#f59e0b' },
 { label: 'Offered', value: analytics.offered, color: '#10b981' },
 { label: 'Rejected', value: analytics.rejected, color: '#ef4444' }
 ];
 };

 const getMonthlyData = () => {
 const monthlyStats = {};
 applications.forEach(app => {
 const date = typeof app.application_date === 'object' ? 
 app.application_date.display_value : app.application_date;
 if (date) {
 const month = date.substring(0, 7); // YYYY-MM
 monthlyStats[month] = (monthlyStats[month] || 0) + 1;
 }
 });

 return Object.entries(monthlyStats)
 .sort(([a], [b]) => a.localeCompare(b))
 .map(([month, count]) => ({
 label: new Date(month + '-01').toLocaleDateString('en-US', { 
 month: 'short', 
 year: 'numeric' 
 }),
 value: count,
 color: '#4a90e2'
 }));
 };

 const renderBarChart = (data) => {
 const maxValue = Math.max(...data.map(d => d.value));

 return (
 <div className="chart-container bar-chart">
 <div className="chart-bars">
 {data.map((item, index) => (
 <div key={index} className="bar-item">
 <div className="bar-label">{item.label}</div>
 <div className="bar-container">
 <div 
 className="bar-fill"
 style={{
 height: `${(item.value / maxValue) * 200}px`,
 backgroundColor: item.color
 }}
 >
 <span className="bar-value">{item.value}</span>
 </div>
 </div>
 </div>
 ))}
 </div>
 </div>
 );
 };

 const renderPieChart = (data) => {
 const total = data.reduce((sum, item) => sum + item.value, 0);
 let currentAngle = 0;

 return (
 <div className="chart-container pie-chart">
 <div className="pie-wrapper">
 <svg viewBox="0 0 200 200" className="pie-svg">
 {data.map((item, index) => {
 const percentage = (item.value / total) * 100;
 const angle = (item.value / total) * 360;
 const largeArcFlag = angle > 180 ? 1 : 0;

 const x1 = 100 + 80 * Math.cos((currentAngle * Math.PI) / 180);
 const y1 = 100 + 80 * Math.sin((currentAngle * Math.PI) / 180);
 const x2 = 100 + 80 * Math.cos(((currentAngle + angle) * Math.PI) / 180);
 const y2 = 100 + 80 * Math.sin(((currentAngle + angle) * Math.PI) / 180);

 currentAngle += angle;

 if (item.value === 0) return null;

 return (
 <path
 key={index}
 d={`M 100 100 L ${x1} ${y1} A 80 80 0 ${largeArcFlag} 1 ${x2} ${y2} Z`}
 fill={item.color}
 stroke="#1a1a1a"
 strokeWidth="2"
 />
 );
 })}
 </svg>
 <div className="pie-legend">
 {data.map((item, index) => (
 <div key={index} className="legend-item">
 <div 
 className="legend-color" 
 style={{ backgroundColor: item.color }}
 ></div>
 <span className="legend-text">
 {item.label}: {item.value} ({((item.value / total) * 100).toFixed(1)}%)
 </span>
 </div>
 ))}
 </div>
 </div>
 </div>
 );
 };

 const renderLineChart = (data) => {
 const maxValue = Math.max(...data.map(d => d.value));
 const width = 400;
 const height = 200;
 const padding = 40;

 const points = data.map((item, index) => {
 const x = padding + (index / (data.length - 1)) * (width - 2 * padding);
 const y = height - padding - ((item.value / maxValue) * (height - 2 * padding));
 return { x, y, ...item };
 });

 const pathData = points.map((point, index) => 
 `${index === 0 ? 'M' : 'L'} ${point.x} ${point.y}`
 ).join(' ');

 return (
 <div className="chart-container line-chart">
 <svg viewBox={`0 0 ${width} ${height}`} className="line-svg">
 <path
 d={pathData}
 fill="none"
 stroke="#4a90e2"
 strokeWidth="3"
 strokeLinecap="round"
 strokeLinejoin="round"
 />
 {points.map((point, index) => (
 <g key={index}>
 <circle
 cx={point.x}
 cy={point.y}
 r="5"
 fill="#4a90e2"
 stroke="#1a1a1a"
 strokeWidth="2"
 />
 <text
 x={point.x}
 y={height - 10}
 textAnchor="middle"
 fontSize="10"
 fill="#b0b0b0"
 >
 {point.label}
 </text>
 <text
 x={point.x}
 y={point.y - 10}
 textAnchor="middle"
 fontSize="12"
 fill="#e0e0e0"
 fontWeight="bold"
 >
 {point.value}
 </text>
 </g>
 ))}
 </svg>
 </div>
 );
 };

 const renderDonutChart = (data) => {
 const total = data.reduce((sum, item) => sum + item.value, 0);
 let currentAngle = 0;

 return (
 <div className="chart-container donut-chart">
 <div className="donut-wrapper">
 <svg viewBox="0 0 200 200" className="donut-svg">
 {data.map((item, index) => {
