 const y3 = 100 + 40 * Math.sin(((currentAngle + angle) * Math.PI) / 180);
 const x4 = 100 + 40 * Math.cos((currentAngle * Math.PI) / 180);
 const y4 = 100 + 40 * Math.sin((currentAngle * Math.PI) / 180);

 currentAngle += angle;

 if (item.value === 0) return null;

 return (
 <path
 key={index}
 d={`M ${x1} ${y1} A 80 80 0 ${largeArcFlag} 1 ${x2} ${y2} L ${x3} ${y3} A 40 40 0 ${largeArcFlag} 0 ${x4} ${y4} Z`}
 fill={item.color}
 stroke="#1a1a1a"
 strokeWidth="2"
 />
 );
 })}
 <text
