 ></div>
 <span className="legend-text">
 {item.label}: {item.value}
 </span>
 </div>
 ))}
 </div>
 </div>
 </div>
 );
 };

 const renderHorizontalBar = (data) => {
 const maxValue = Math.max(...data.map(d => d.value));

 return (
 <div className="chart-container horizontal-bar-chart">
